import React from "react";

const FilterButtons = () => {
	return (
		<div className="container center">
			<button className="spacing btn-small blue">All</button>
			<button className="spacing btn-small blue">Active</button>
			<button className="spacing btn-small blue">Complete</button>
		</div>
	);
};

export default FilterButtons;
